Sample Prompt:
Example_1:
input: [0, 3, 3, 3, 0, 0, 8]
output: [0, 0, 0, 3, 3, 3, 8]

Example_2:
input: [2, 2, 2, 0, 0, 0, 8]
output: [0, 0, 0, 2, 2, 2, 8]

Example_3:
input: [3, 3, 3, 0, 0, 0, 8]
output: [0, 0, 0, 3, 3, 3, 8]

Test case:
input: [4, 4, 4, 0, 0, 0, 8]

###########################################################
Sample Outputs:
output: [0, 0, 0, 4, 4, 4, 8]
*/

public class MoveZeroesToEnd {
    public static void main(String[] args) {
        int[] arr = new int[]{0, 3, 3, 3, 0, 0, 8};
        moveZerosToEnd(arr);
        for (int i : arr) {
            System.out.print(i + " ");
        }
    }

    private static void moveZerosToEnd(int[] arr) {
        if (arr == null || arr.length <= 1) return;
        int j = -1;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i]!= 0) {
                j++;
                swap(arr, i, j);
            }
        }
    }

    private static void swap(int[] arr, int i, int j) {
        int temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }
}
